import React from 'react';
import './AccommodationList.less';
import AccommodationCard from '../AccommodationCard/AccommodationCard';

const accommodationList = [
  {
    id: 2,
    price: 35000,
    description: 'Сдаётся 2 этажная квартира с финской сауной, панорамным остеклением в стиле ЛОФТ.'
      + 'Квартира охраняемом комплексе бизнес класса Сдаётся 2 этажная квартира с финской сауной, панорамным остеклением в стиле ЛОФТ.'
      + 'Квартира охраняемом комплексе бизнес класса',
    floor: 3,
    maxFloor: 5,
    roomCount: 2,
    address: 'Москва, ЦАО, р-н Пресненский, м. Выставочная, 1-й Красногвардейский проезд, 21с2',
  },
];

const AccommodationList: React.FC = () => (
  <div>
    {accommodationList.map((accommodation) => (
      <AccommodationCard accommodation={accommodation} key={accommodation.id} />
    ))}
  </div>
);

export default AccommodationList;
